description:
Adriana Chechik has a few art sculptures that her neighbor, Michael Vegas, is interested in buying. Adriana never took Michael for an art guy, but she was apparently wrong. Guys who like art get Adriana hot and bothered. She is no longer interested in cash for the sculptures, she wants Michael's dick instead, and boy does he give it to her good.


